import React from "react";
import { logoLightText } from "../assets";

export const Footer = () => {
  return (
    <div className="bg-black text-[#949494] py-20 font-titleFont px-40 flex justify-between">
      <div className="flex flex-col gap-4 w-1/3 px-4">
        <img src={logoLightText} className="w-60" alt="" />
        <input
          type="text"
          placeholder="Enter your email"
          className="bg-transparent border-b-[0.5px] border-b-gray-200 py-2 placeholder:text-gray-300"
        />
      </div>
      <div className="w-1/3 px-4 bg-red-50"></div>
      <div className="w-1/3 px-4 bg-blue-300"></div>
    </div>
  );
};
